import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Accueil from './client/pages/Accueil';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Accueil />} />
        {/* autres routes */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
